	private static String minRemoveToMakeValid(String s) {
        if(null == s || s.isEmpty())
            return s;
        
        Stack<Character> st = new Stack<Character>();
        int open = 0, closed = 0;
        
        for(int index = 0; index < s.length(); index++) {
            char ch = s.charAt(index);
            if(ch == ')') {
                if(closed < open) {
                	closed++;
                	st.push(ch);
                }
            }

            else if(ch == '(') {
                open++;
                st.push(ch);
            }
            
            else {
                st.push(ch);
            }
        }
        
        String res = "";
        if(open == closed) {
            while(!st.isEmpty()) {
                res = st.pop() + res;
            }            
            return res;
        }
        
        open = closed = 0;
    
        while(!st.isEmpty()) {
            char ch = st.pop();
            
            if(ch == '(') {
                if(open < closed) {
                    open++;
                    res = ch + res;
                }
            }
            
            else if(ch == ')') {
                closed++;
                res = ch + res;
            }
            else {
                res = ch + res;
            }
        }
        return res;
    }

